import "../post.css";

class Post extends Component{
	render(){
		return(
			<div className={"post"}>
		      <h3>Texto do post </h3>
		      <small>15:00</small>
		      <div style={likeLine}>
		      <p>Likes: 100 </p>
			      <button style={{'backgroundColor': 'blue' ,
			      'color':'White' ,
			      'fonteSize':16,
			      'border':'none',
			      'borderRadius':'10'	
		  		}}> Like </button>
    		</div>
    		</div>
			)
	}

}
const likeLine={
	'display':'flex',
	'justifyContent':'space-around'
}

export default Post;
